import React from "react";
import Nav from "react-bootstrap/Nav";

let json = [
  {
    name: "Лена Новикова",
    id: "2",
    phone: "89764554323",
    gender: "Мужской",
    birthday: "09.12.1986",
    subway: "Василеостровская",
    address: "Наставников 15 к2 кв33",
    bank: "ВТБ",
    card: "3333 4445 4532 3353",
    nationality: "РФ",
    passport: "4565 567887",
    issued_by: "ТП 44 по СПб и Лен обл",
    validity: "12.09.2024",
    birthplace: "Узбекистан"
  },
];

const NavBar = () => {
  return (
    <Nav justify variant="tabs" defaultActiveKey="/home">
      <Nav.Item>
        <Nav.Link href="/home">Active</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-1">Loooonger NavLink</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-2">Link</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="disabled" disabled>
          Disabled
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );
};

export default NavBar;
